script: |
  super -f text -I q2730.spq | sort > q2730.out

inputs:
  - name: q2730.spq
    data: |
      SELECT DISTINCT + col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN NULL AND ( - 19 * + + ( - col0 ) / - 17 + CAST ( NULL AS INTEGER ) - - + col2 / col2 );
  - name: tab2

outputs:
  - name: q2730.out
    data: |
